CREATE TABLE Kategorie (id_kategorii INT PRIMARY KEY, nazwa VARCHAR(100));
CREATE TABLE Autorzy (id_autora INT PRIMARY KEY, imie VARCHAR(100), nazwisko VARCHAR(100), kraj_pochodzenia VARCHAR(100));
CREATE TABLE Czytelnicy (id_czytelnika INT PRIMARY KEY, imie VARCHAR(100), nazwisko VARCHAR(100), email VARCHAR(150));
CREATE TABLE Ksiazki (id_ksiazki INT PRIMARY KEY, tytul VARCHAR(255), id_autora INT, id_kategorii INT, rok_wydania INT, FOREIGN KEY (id_autora) REFERENCES Autorzy(id_autora), FOREIGN KEY (id_kategorii) REFERENCES Kategorie(id_kategorii));
CREATE TABLE Wypozyczenia (id_wypozyczenia INT PRIMARY KEY, id_czytelnika INT, id_ksiazki INT, data_wypozyczenia DATE, data_zwrotu DATE, FOREIGN KEY (id_czytelnika) REFERENCES Czytelnicy(id_czytelnika), FOREIGN KEY (id_ksiazki) REFERENCES Ksiazki(id_ksiazki));

